"    <div id=\"topicTitle\">",
"     Patient information: Reactive arthritis (Reiter syndrome) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/reactive-arthritis-reiter-syndrome-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H18611470\">",
"      <span class=\"h1\">",
"       What is reactive arthritis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Reactive arthritis is a kind of arthritis that happens after an infection. It causes pain and swelling in joints.",
"     </p>",
"     <p>",
"      Reactive arthritis usually affects people who have or just had:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Food poisoning or another kind of infection of the intestines",
"       </li>",
"       <li>",
"        An infection that you catch through sex",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Reactive arthritis is sometimes called &ldquo;Reiter syndrome.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18611485\">",
"      <span class=\"h1\">",
"       What are the symptoms of reactive arthritis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The main symptoms of reactive arthritis are pain and swelling in the joints. These usually happen 1 to 4 weeks after an infection. In most cases, the symptoms affect only a few joints, usually in the knees, ankles, or feet.",
"     </p>",
"     <p>",
"      Other symptoms might include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Pain in the tendons in the feet and ankles (tendons are tough bands of tissue that connect muscles to bones)",
"       </li>",
"       <li>",
"        Irritation of the eye called &ldquo;conjunctivitis&rdquo; (also known as pinkeye)",
"       </li>",
"       <li>",
"        Pain when urinating",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18611500\">",
"      <span class=\"h1\">",
"       Is there a test for reactive arthritis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No. There is no test. But if your doctor or nurse can figure out what type of germ caused your infection, he or she should be able to tell if you have reactive arthritis. Your doctor or nurse can test your stool (bowel movements) or urine to look for certain kinds of germs.",
"     </p>",
"     <p>",
"      If your doctor or nurse can&rsquo;t tell what germs caused your infection, he or she will study your symptoms to decide how likely it is that you have reactive arthritis.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18611515\">",
"      <span class=\"h1\">",
"       How is reactive arthritis treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms of reactive arthritis are treated with medicines, including:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        NSAIDs &ndash; This is a large group of medicines that includes",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?14/17/14614?source=see_link\">",
"         ibuprofen",
"        </a>",
"        (sample brand names: Advil&reg;, Motrin&reg;) and",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?43/35/44597?source=see_link\">",
"         naproxen",
"        </a>",
"        (sample brand names: Aleve&reg;, Naprosyn&reg;). Your doctor or nurse might prescribe a dose higher than you would normally take to relieve pain.",
"        <br/>",
"       </li>",
"       <li>",
"        Other medicines &ndash; If NSAIDs do not help your symptoms, your doctor or nurse might give you a shot of steroids. Steroids help reduce inflammation. These steroids are not the same ones that athletes use to build muscle. Your doctor might also give you more steroids to take at home.",
"        <br/>",
"        <br/>",
"        There are also other medicines that might help if your symptoms do not get better with NSAIDs or steroids.",
"        <br/>",
"       </li>",
"       <li>",
"        Eye drops &ndash; Special drops can help relieve redness and irritation in your eyes. But if you have eye pain or trouble seeing, visit an eye doctor to make sure you don&rsquo;t have a more serious problem.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Antibiotics do not usually help with the joint symptoms of reactive arthritis. Even so, your doctor or nurse might prescribe them if you still have an infection.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H18611530\">",
"      <span class=\"h1\">",
"       When will I feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people with reactive arthritis get better quickly. Some people continue to notice symptoms, either constantly or just once in a while.",
"     </p>",
"     <p>",
"      If your back gets very stiff and sore, see your doctor or nurse. This might mean that your reactive arthritis has turned into a more serious problem.",
"     </p>",
