"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F52026&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Hemochromatosis two years after start of phlebotomy treatment (low power, Masson trichrome)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 252px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The biopsy is normal. There were more than 20 portal triads in this specimen and no signs of the scarring that was seen in the baseline liver biopsy. There were also no granulomas.",
"    <div class=\"footnotes\">",
