var title_f29_0_29708="Anaphylaxis triggers";
var content_f29_0_29708=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F70667&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F70667&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Triggers of anaphylaxis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Allergen triggers (IgE-dependent immunologic mechanism)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Foods, especially peanut, tree nut, shellfish, fish, milk, egg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Insect stings (eg, Hymenoptera venom) and insect bites (eg, kissing bugs, mosquitoes)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Medications (eg, beta-lactam antibiotics, some nonsteroidal antiinflammatory drugs [NSAIDs])",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Biological materials, including allergens, allergen immunotherapy, monoclonal antibodies, vaccines to prevent infectious disease, and hormones (eg, progesterone)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Natural rubber latex",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Food additives, including spices, insect-derived colorants (eg, carmine), and vegetable gums",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Inhalants (rare), eg, horse dander",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Human seminal fluid (rare)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Occupational allergens (eg, stinging insects, natural rubber latex)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Immunologic triggers (IgE-independent mechanism)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        IgG-dependent (rare) eg, to high molecular weight dextran, infliximab",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Coagulation system activation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Idiopathic anaphylaxis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Consider the possibility of a hidden or previously unrecognized trigger",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Consider the possibility of mastocytosis or a clonal mast cell disorder",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Non-immunologic triggers (direct activation of mast cells and basophils)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Physical factors (eg, exercise*, cold, heat, sunlight/ultraviolet radiation)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Medications (eg, opioids, some NSAIDs)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Alcohol (ethanol)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Any food, insect sting or bite, or medication or biological, can potentially trigger anaphylaxis. Novel or unusual allergen triggers are frequently described. These include foods such as vegetables, fruits, lupin flour, bird's nest soup, seal, whale, and kangaroo meats, and storage mite-contaminated flour. They also include saliva from kissing bugs, mosquitoes, pigeon ticks, green ants, and pharaoh ants, and venoms from jellyfish, scorpions, and snakes. Medications include taxanes, platins, and other chemotherapy drugs; biologic agents, including monoclonal antibodies such as rituximab, cetuximab, infliximab, and uncommonly, omalizumab. Other injectants and ingestants, including Botox, bee products, and herbal formulations are also implicated.",
"    <br>",
"     Some triggers such as insect venoms, medications and radiocontrast media (such as nonsteroidal antiinflammatory drugs [NSAIDs]) act through more than one mechanism.",
"     <div class=\"footnotes\">",
"      * Usually involves a co-trigger such as a&nbsp;food, medication (eg, an&nbsp;NSAID),&nbsp;or exposure to cold air or water.",
"     </div>",
"     <div class=\"reference\">",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
